import React from "react";
import SEO from "../../../common/SEO";
import Footer from "../../Footer/Footer";
import Header from "../../Header/Header";
import Subs from "../../Subscriptions/Subs";
import Separator from "../../../components/separator/Separator";
import About from "./About";
import About1 from "./About1";
import About3 from "./About3";

const ihelpDeal = () => {
  return (
    <>
      <SEO title="ihelpDeal" />
      <main className="page-wrapper">
        <Header btnStyle="btn-small" HeaderSTyle="header-not-transparent" />

        {/* Start Slider Area  */}
        <div className="slider-area slider-style-3 height-850">
          <div className="container">
            <div className="row row--30 align-items-center">
              <div className="order-2 order-lg-1 col-lg-7 mt_md--50 mt_sm--50 mt_lg--30">
                <div className="inner text-left">
                  <h1 className="title theme-gradient">ihelp deal</h1>
                  <p className="description">
                    Бизнес хэлэлцээр & Борлуулалтын үйлчилгээ
                  </p>
                </div>
              </div>
              <div className="order-1 order-lg-2 col-lg-5">
                <div className="thumbnail">
                  <img
                    src="./images/ihelplogo/dealW1.png"
                    alt="Banner Images"
                  />
                </div>
              </div>
            </div>
          </div>
        </div>
        {/* End Slider Area  */}

        <Separator />

        {/* Start Elements Area  */}
     
        <About />

        <Separator />
        <About3 />
        <Separator />
        <About1 />
        <Separator />

        <Subs />
        <Separator />

        <Footer />
      </main>
    </>
  );
};
export default ihelpDeal;
